import axios from "axios";
import "../App.css";

function formatDateOnly(value) {
  if (!value) return "—";
  const d = new Date(value);
  if (isNaN(d)) return "—";
  return new Intl.DateTimeFormat("en-IN", {
    timeZone: "Asia/Kolkata",
    dateStyle: "medium"
  }).format(d);
}

export default function ExpenseList({ expenses = [], fetchExpenses, setMessage }) {
  if (!expenses.length) {
    return (
      <div className="card">
        <h2>📜 Expense List</h2>
        <p>No expenses to show. Use filter to view expenses.</p>
      </div>
    );
  }

  const handleDelete = async (exp) => {
    try {
      console.log("Delete request for expense:", exp);
      const dateStr = exp.date.split("T")[0]; // extract YYYY-MM-DD
      console.log("Delete URL:", `http://127.0.0.1:5000/api/expenses/${dateStr}/${exp.id}`);

      const response = await axios.delete(`http://127.0.0.1:5000/api/expenses/${dateStr}/${exp.id}`);
      console.log("Delete response:", response);

      setMessage("🗑️ Expense deleted successfully!");
      setTimeout(() => setMessage(""), 3000);
      fetchExpenses(); // refresh list
    } catch (err) {
      console.error("Delete failed - Full error:", err);
      console.error("Error response:", err.response?.data);
      console.error("Error status:", err.response?.status);
      setMessage(`❌ Failed to delete expense: ${err.response?.data?.error || err.message}`);
    }
  };

  const total = expenses.reduce((sum, exp) => sum + Number(exp.amount || 0), 0);

  return (
    <div className="card">
      <h2>📜 Expense List</h2>
      <table>
        <thead>
          <tr>
            <th>Type</th>
            <th>Details</th>
            <th>Amount</th>
            <th>Category</th>
            <th>Date</th>
            <th>Bill Image</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {expenses.map((exp, i) => (
            <tr key={exp.id || i}>
              <td>{exp.imageUrl ? "📸 Bill" : "🛒 Grocery"}</td>
              <td>{exp.imageUrl ? `Supermarket: ${exp.supermarket}` : `Item: ${exp.title}`}</td>
              <td className="amount">₹{exp.amount}</td>
              <td>{exp.category || "—"}</td>
              <td>{formatDateOnly(exp.date)}</td>
              <td>
                {exp.imageUrl ? (
                  <a href={exp.imageUrl} target="_blank" rel="noopener noreferrer">
                    <img
                      src={exp.imageUrl}
                      alt="bill"
                      style={{ width: "50px", height: "50px", objectFit: "cover", borderRadius: "6px" }}
                    />
                  </a>
                ) : (
                  "—"
                )}
              </td>
              <td>
                <button
                  style={{ background: "red", color: "white", border: "none", padding: "5px 10px", cursor: "pointer" }}
                  onClick={() => handleDelete(exp)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}

          <tr style={{ fontWeight: "bold", background: "#f8f8f8" }}>
            <td colSpan="2">TOTAL</td>
            <td className="amount">₹{total}</td>
            <td colSpan="4"></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}
